The article seems to have veered towards being non-neutral. The following are of particular concern:

 The ridiculous amount of detail that the Japan Tobacco episode is given;
 Removal of references to Scruton's response—and defence—to the episode in The Guardian;
 Removal of a positive review (of Dooley's comment that Sexual Desire is ""magisterial"") despite this having being discussed on this talk page;
 The extent of the coverage given to his views on homosexuality.

Any disinterested reader coming across the article could well be forgiven for thinking that Scruton is some kind of dodgy businessman with strong homophobic tendencies—clearly a gross misrepresentation of his life and career. I am therefore putting the neutrality banner up until these issues are addressed.   "

I don't think it's equivalent to the sieve of eratosthenes (even when the optimization of using only odds is used).
Here is what Sieve of Sundaram looks like (where we loop at a = 2i + 1 and b = 2j + 1 instead of i and j):
n ← 1000000 // limit

// initialize the sieve
is_prime(2) ← true
is_prime(i) ← [i is odd], ∀ i ∈ [3, n]

for all odd a such that 3 ≤ a and a² ≤ n:
    for all odd b such that a ≤ b and ab ≤ n:
        is_prime(ab) ← false

while Sieve of Eratosthenes (using only odd integers) roughly looks like this (only one line is added):
n ← 1000000 // limit

// initialize the sieve
is_prime(2) ← true
is_prime(i) ← [i is odd], ∀ i ∈ [3, n]

for all odd a such that 3 ≤ a and a² ≤ n:
    if not is_prime(a): continue      // only this has changed
    for all odd b such that a ≤ b and ab ≤ n:
        is_prime(ab) ← false

This also shows that the Sieve of Sundaram is less efficient than the Sieve of Eratosthenes, and that its complexity is Θ(n log n) (since 1/2 + 1/3 + 1/4 + ... + 1/n grows asymptotically as log n) compared to sieve of eratosthenes' Θ(n log log n) (since 1/2 + 1/3 + 1/5 + 1/7 + ... + 1/p grows asymptotically as log log n).

